CREATE TABLE `purchase` (
  `purchase_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `purchased_on` datetime NOT NULL COMMENT 'date the product was purchased',
  `supplier_id` int(10) unsigned NOT NULL COMMENT 'supplier from whom we purchased the product',
  `product_id` int(10) unsigned NOT NULL COMMENT 'product we purchased',
  `amt_purchased` float NOT NULL COMMENT 'Total price we paid for the qty we purchased the product.',
