CREATE TABLE `sale` (
  `sale_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sold_on` datetime NOT NULL COMMENT 'time the sale was made',
  `product_id` int(10) unsigned NOT NULL COMMENT 'the product that was sold',
  `customer_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'the customer to whom the product was sold.',
  `sale_amt` float NOT NULL COMMENT 'sale price',
  `qty_sold` int(10) NOT NULL,
  `qty_uom_id` int(11) NOT NULL,
  `comments` varchar(255) DEFAULT NULL,
  `is_amendment` bit(1) NOT NULL DEFAULT b'0' COMMENT 'is this an amendment transaction',
  `is_reversal` bit(1) NOT NULL DEFAULT b'0' COMMENT 'is this a reversal amendment transaction',
  `updated_on` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_by` varchar(50) NOT NULL,
  PRIMARY KEY (`sale_id`),
  KEY `sale_product_fk` (`product_id`),
  KEY `sale_customer_fk` (`customer_id`),
  KEY `sale_qty_uom_f` (`qty_uom_id`),
  CONSTRAINT `sale_customer_fk` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`customer_id`),
  CONSTRAINT `sale_product_fk` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`),
  CONSTRAINT `sale_qty_uom_f` FOREIGN KEY (`qty_uom_id`) REFERENCES `qty_uom` (`qty_uom_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4258 DEFAULT CHARSET=utf8;
